import React from 'react';
import ReactDOM from 'react-dom';
import ProductList from './productList'; // Asegúrate de que la ruta del archivo sea correcta

const Test = ({ products }) => {
    return (
      <div>
        <h2>Productos Disponibles</h2>
        <ul>
          {products.map(product => (
            <li key={product.id}>
              {product.nombre} - {product.precio}
            </li>
          ))}
        </ul>
      </div>
    );
  }

// Renderizamos el componente Test en el elemento con id 'root'
ReactDOM.render(<Test />, document.getElementById('root'));

export default Test;
